# Definition for a binary tree node.
import collections
class Solution(object):
    def updateMatrix(self, mat):
        """
        :type mat: List[List[int]]
        :rtype: List[List[int]]
        """
        m = len(mat)
        n = len(mat[0])
        
        self.res = [[-1 for j in range(n) ] for i in range(m)] 
        for i in range(m):
            for j in range(n):
                if not mat[i][j]:
                    self.res[i][j] = 0
                    
        def dfs( s, t):
            step = [[-1, 0], [1, 0], [0, 1], [0, -1]]
            for [i, j] in step:
                if -1<s+i<m and -1<t+j<n and self.res[s+i][t+j]<0:
                    self.res[s+i][t+j] = self.res[s][t] + 1
                    dfs(s+i, t+j)
        
        for i in range(m):
            for j in range(n):
                if not mat[i][j]:
                    dfs(i, j)
        return self.res
    
                    
            
            
        
